        insertTelPhoneMeassgeList.add("INSERT INTO TEL_PHONE_LIST VALUES('428','3','110','110','a110','','「はい、こ、こちら町川警察署です。■ど、どうしました？」■男性警察のようだ。■なんだか頼りない感じの声に聞こえる。■「はい、こ、こちら町川警察署です。■ど、どうしました？」■「すみません、公衆電話ボックスが開かず、■中に閉じ込められてしまったので、助けてほしいんです。」■「うそっ！？・・・じゃない、失礼。■わかりました。まずはちょと落ち着きましょう。■まずあなたの名前と年齢をいいですか？」■・・・落ち着くのは、この警察のような気がする。■もしかして新人警察だろうか。■「岩筋祐紀です。年は30になります。」■「いわすじ・・・ゆうき・・・さんですね。■「お巡りさんすみません。担当直入に言います。■信じられないかもしれませんが、■私は10年先から電話をかけている・・・と思う」■「ようは未来から電話しているってことです。」■「はぁ■まあ困っている人がいれば、助けるのが警察の務めです。■何かあれば助けますけど、どう助けたらいいですか？」■「それこっちに聞いちゃうんですか」■俺はしばらく考えたあと、1つのアイデアが閃いた。■いつの間にか時間がオーバーしていたようだ。■電話が切れてしまっている。','');");
